import React, { Component } from 'react'
import { Container, Box } from '@material-ui/core'
import logo from '../media/logo.PNG';

export default class Login extends Component {
    render() {
        return (
            <Container maxWidth="sm">
                <Box bgcolor="primary.main">
                    Login
                    <img src={logo}/>
                </Box>
            </Container>
        )
    }
}
